import dynamic from "next/dynamic";

const DynamicComponent = dynamic(() =>
  import("../components/dynamic/hello1").then(mod => mod.Hello1)
);

function Home() {
  return (
    <div>
      <Header />
      <DynamicComponent />
      <p>HOME PAGE is here!</p>
    </div>
  );
}

export default Home;
